er.'=>'Saknar obligatorisk parameter.','More info about performance optimization'=>'Mer information om prestandaoptimering','More information about %s'=>'Mer information om %s','No plugins found in the API response.'=>'Inga tillägg hittades i API-svaret.','OK'=>'OK','Option Name'=>'Namn på alternativ','Output Buffering'=>'Buffring av utdata','Output buffering has been forcibly disabled via the %s filter.'=>'Buffring av utdata har inaktiverats med tvång via filtret %s.','Output buffering has been forcibly enabled via the %s filter.'=>'Buffring av utdata har aktiverats med tvång via filtret %s.','Output buffering is needed to capture metrics after headers have been sent and while the template is being rendered. Note that output buffering may possibly cause an increase in TTFB if the response would be flushed multiple times.'=>'Buffring av utdata behövs för att samla in mätvärden efter att ”headers” har skickats och medan mallen renderas. Observera att buffring av utdata eventuellt kan leda till att värdet TTFB ökar om svaret från webbservern skrivs om flera gånger.','Performance'=>'Prestanda','Performance Features'=>'Prestandafunktioner','Performance Lab'=>'Performance Lab','Performance plugin from the WordPress Performance Team, which is a collection of standalone performance features.'=>'Prestandatillägg från ”WordPress Performance Team”, som innehåller en samling av fristående prestandafunktioner.','Permission denied.'=>'Behörighet nekad.','Plugin not found among installed plugins.'=>'Tillägget hittades inte bland installerade tillägg.','Plugin not found in API response.'=>'Tillägg hittades i API-svaret.','Plugins list'=>'Tilläggslista','Revert to Autoload'=>'Återgå till automatisk laddning','Review <a href="%s">settings</a>.'=>'Granska <a href="%s">inställningarna</a>.','Server-Timing'=>'Server-tidtagning','Settings'=>'Inställningar','Settings > Performance'=>'Inställningar > Prestanda','Since the %1$s header is sent before the template is loaded, only hooks befor